Tensorflow.NET:
model.predict((xx1), batch_size: 128); 300ms (GPU)
model.predict((xx1), batch_size: 128); 15000ms (CPU)

GPU 4090. 

Not sure what else to try, or what I'm missing to get the predictions closer to python speed.

It's a 800,000 param Yolo model attached. 

I've attached the onnx model (acquired from tfToOnnx), and the original h5 model.  I can see the GPU jump to 60% utilization when it's running. Couldn't get OnnxRuntime.DirectML working to give that a tru over .GPU.

